import React from "react";
import { Block, Container } from "./Forecast";
import ConvertDate from "../customF/ConvertDate";

const Useless = ({ wind, sunset, sunrise }) => {
    const { hour, minute } = ConvertDate(sunrise);
    return (
        <Container>
            <Block>{wind}</Block>
            <Block>{hour}</Block>
            <Block>{minute}</Block>
        </Container>
    );
};

export default Useless;
